import React from 'react';

const Register = () => {
  return (
	  <div>
      <p className='f3'>
        {'Welcome to PRS Game. Please register so you can start the game'}
      </p>
      <div className='center'>
        <div className='pa4 br3 shadow-5'>
          <button className='w-30 grow f5 link ph3 pv2 dib white bg-dark-blue'>Register</button>
        </div>
	    </div>
    </div>
  );
}

export default Register;
